Samsung ikuwoneka kuti ili nayo adapanga chisankho chotsatira Apple pa Galaxy S30 potero pewani kukhala ndi charger ndi mahedifoni. Ndi nkhani yomwe yangofika kumene pompano. Ndikutanthauza, inde Apple imasunga mtengo wowonjezerapo Kuti ipeze malire pa iPhone yake, kampani yaku Korea ikufuna kutsatira njira yomweyi yowonjezera phindu pa Galaxy S30 iliyonse yomwe imagulitsa. Ndipo titha kumvetsetsa bwino. Ngati kale izi chilimwe chathachi kunamveka kuti Samsung siphatikizira charger Pamapeto pake
..........
mu phukusi lake kuyika SIM khadi ya foni. Ndipo zowonadi, mudzawona kunyozedwa kuchokera kwa iwo omwe alandila kutsutsa chisankho cha Apple, koma pamlingo woyenera ndikusuntha kosangalatsa kwa Samsung. Tsopano tili nazo zokha Onani ngati Samsung ichepetsa mtengo wa Galaxy S30 yake yatsopano kusowa kwa zida ziwirizi, ngakhale ndizomwe zikuwonjezerapo kukweza mitengo yamtengo wapamwamba, zikuwoneka kuti ndizachilendo. Chodziwikiratu ndikuti mudzakhala ndi phindu lochulukirapo pachida chilichonse;
